// src/TriggerDemo.js
import React, { useState, useEffect } from 'react';
import { Tabs, Tab } from 'react-bootstrap'; // Use Bootstrap for tabs
import CreateTrigger from './components/CreateTrigger'; // Import the CreateTrigger component
import { loadCampusMap, loadCampuses, renderZones } from './static/campusMapLoader.js';  // Import the map-related functions

const TriggerDemo = () => {
  const [maps, setMaps] = useState([]);
  const [zones, setZones] = useState([]);
  const [selectedZone, setSelectedZone] = useState(null);
  const [selectedMap, setSelectedMap] = useState(null);
  const [triggerName, setTriggerName] = useState('');
  const [triggerDirection, setTriggerDirection] = useState('While In');
  const [topElevation, setTopElevation] = useState(8);
  const [bottomElevation, setBottomElevation] = useState(-1);
  const [triggerColor, setTriggerColor] = useState('Red');
  const [eventList, setEventList] = useState([]);
  const [coordinates, setCoordinates] = useState('');

  // Fetch all maps when the component mounts
  useEffect(() => {
    fetch('/get_maps')
      .then((response) => response.json())
      .then((data) => setMaps(data))
      .catch((error) => console.error('Error fetching maps:', error));
  }, []);

  // Fetch zones for a specific campus once a map is selected
  useEffect(() => {
    if (selectedMap) {
      const campusId = selectedMap.campus_id;  // Assuming the map has a `campus_id` field
      fetch(`/get_campus_zones/${campusId}`)
        .then((response) => response.json())
        .then((data) => setZones(data))
        .catch((error) => console.error('Error fetching zones:', error));
    }
  }, [selectedMap]);

  const handleCreateTrigger = () => {
    const newEvent = `${triggerName} created at ${coordinates} with ${triggerDirection} direction`;
    setEventList([...eventList, newEvent]);
  };

  const handleMapSelect = (mapId) => {
    // Fetch map data when a map is selected
    fetch(`/get_map/${mapId}`)
      .then((response) => response.json())
      .then((data) => setSelectedMap(data[0]))  // Assuming the map data is in the first object
      .catch((error) => console.error('Error fetching map:', error));
  };

  const handleZoneSelect = (zoneId) => {
    setSelectedZone(zoneId);
  };

  return (
    <div>
      <h1>ParcoRTLS Trigger Management</h1>

      <Tabs defaultActiveKey="mapAndTrigger" id="trigger-demo-tabs">
        <Tab eventKey="mapAndTrigger" title="Map & Trigger">
          <div className="trigger-map-section">
            {/* Trigger Configuration Form */}
            <div className="trigger-form">
              <h3>Create Trigger</h3>
              <input
                type="text"
                placeholder="Trigger Name"
                value={triggerName}
                onChange={(e) => setTriggerName(e.target.value)}
              />
              <select onChange={(e) => setTriggerDirection(e.target.value)}>
                <option value="While In">While In</option>
                <option value="While Out">While Out</option>
              </select>
              <input
                type="number"
                placeholder="Top Elevation"
                value={topElevation}
                onChange={(e) => setTopElevation(Number(e.target.value))}
              />
              <input
                type="number"
                placeholder="Bottom Elevation"
                value={bottomElevation}
                onChange={(e) => setBottomElevation(Number(e.target.value))}
              />
              <select onChange={(e) => setTriggerColor(e.target.value)}>
                <option value="Red">Red</option>
                <option value="Blue">Blue</option>
                <option value="Green">Green</option>
              </select>
              <button onClick={handleCreateTrigger}>Create Trigger</button>
            </div>

            {/* Map and Zone Selection */}
            <div className="map-selection">
              <h3>Select a Map</h3>
              <select onChange={(e) => handleMapSelect(e.target.value)} value={selectedMap ? selectedMap.map_id : ''}>
                <option value="">Select Map</option>
                {maps.map((map) => (
                  <option key={map.map_id} value={map.map_id}>
                    {map.name}
                  </option>
                ))}
              </select>

              {selectedMap && (
                <div>
                  <h3>Select a Zone</h3>
                  <select onChange={(e) => handleZoneSelect(e.target.value)} value={selectedZone}>
                    <option value="">Select Zone</option>
                    {zones.map((zone) => (
                      <option key={zone.zone_id} value={zone.zone_id}>
                        {zone.name}
                      </option>
                    ))}
                  </select>

                  <div id="zoneCanvasContainer">
                    {/* The canvas for drawing zones and vertices */}
                    <canvas id="zoneCanvas" width="800" height="600"></canvas>
                  </div>

                  {/* Load Zones and Vertices */}
                  <button onClick={() => renderZones(zones)}>Load Zones</button>
                </div>
              )}
            </div>
          </div>
        </Tab>
      </Tabs>
    </div>
  );
};

export default TriggerDemo;
